import React from "react";
const cnst_bg = require("../../assets/cnst_bg4.jpg").default;
const Construction = () => {
  return (
    <div className="justify-content-center row">
      <div
        style={{
          position: "absolute",
          textAlign: "center",
          justifyContent: "center",
          alignItems: "center",
          color: "white",
          fontWeight: "bold",
          fontSize: 30,
        }}
      >
        <div>
          <p>We build quality Homes</p>

          <p>100% Hassle-Free and Managed by us!</p>
        </div>
      </div>

      <img src={cnst_bg} style={styles.image} />
    </div>
  );
};

const styles = {
  bg: {
    backgroundImage: `url(${cnst_bg})`,
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "",
    width: "100vw",
    height: "80vh",
    textAlign: "center",
    filter: "50%",
  },
  p: {
    fontSize: 25,
    marginTop: "15%",
    textAlign: "center",
    maxWidth: 700,
  },
  image: {
    width: "100%",
    // height: "10",
  },
};
export default Construction;
